import React from 'react';
import SortCity from './resources/SortCity'

function City (props) {
  let sortCity = SortCity()
  let sortCityInput=""
  for (var i=0; i<=sortCity.length; i++) {
    console.log(sortCity[i].city)
  }
  return (
    <div className="city">
      <div className="headingLayout">
        Ваш город
      </div>
      <div className="menuLayout">
        <select className="selectMenu">
          {sortCityInput}
        </select>
      </div>
    </div>
  )
}

export default City
